import { useParams } from "react-router-dom";

const EventsDetailPage = () => {
  const id = useParams();
  return (
    <>
      <h1>Events Detail Page</h1>
      <p>Event id is {id}</p>
    </>
  );
};

export default EventsDetailPage;
